INSERT INTO `classes` (`id`, `title`, `sub_title`, `slug`, `trainer`, `author`, `category`, `date_time`, `image`, `description`, `short_description`, `meta_description`, `link_title`, `link_action`, `custom_id`, `custom_class`, `active`, `hit_count`, `created_by`, `updated_by`, `created_at`, `updated_at`) VALUES
(1, 'Signature Beach Flow', 'Rise And Shine', 'test-class-title', 'Walter, Adrienne, Dani, Vanessa, Ally, Vee', 'Managment', 'All Levels', 'Saturday & Sundays', 'images/VKzTHhU3Q9Qf60VY9gzdp5YhPRmWY3rw9MkomyGO.jpg', '<p>Start your day with an uplifting early-morning yoga class on the beach. Join an experienced instructor and fellow fitness enthusiasts on the beach for an energizing yoga session that\'s suitable for all ability levels. </p><p>There\'s no need to bring any worries—just come as you are!&nbsp;<span style=\"font-size: 1rem;\">You\'ll enjoy a soothing program of breathing exercises followed by a series of poses, with your instructor assisting you as needed. </span></p><p><span style=\"font-size: 1rem;\">Rise and shine every Monday and Tuesday at 6:15 am with the stillness of sunrise and waves gently lapping the shore.</span></p>', 'Start your day with an uplifting early-morning yoga class on the beach. Join an experienced instructor and fellow fitness enthusiasts on the beach for an energizing yoga session that\'s suitable for all ability levels.', NULL, 'Book Now', 'https://www.beachyogasocal.com/schedule', 'Yoga', NULL, 'on', NULL, '19', '31', '2021-09-03 04:53:42', '2021-10-13 04:31:17'),
(2, 'Beach Flow', 'Wake Up Your Senses', 'test-class-title', 'Walter, Adrienne, Dani, Vanessa, Ally, Vee', 'Managment', 'All Levels', 'Monday - Sunday', 'images/t2IfoKbPP6gGjEfMyX2yPSUUIF2oUVjb8kx67Nhk.jpg', '<p style=\"box-sizing: inherit; backface-visibility: hidden; margin: 1rem 0px 0px; padding: 0px; border: 0px; font-family: &quot;Nunito Sans&quot;, sans-serif;\">Beach flow yoga is a class for all levels and ages.</p><p style=\"box-sizing: inherit; backface-visibility: hidden; margin: 1rem 0px 0px; padding: 0px; border: 0px; font-family: &quot;Nunito Sans&quot;, sans-serif;\">Stretch and strengthen your muscles while breathing in the fresh air. Work up a sweat and cool off in the ocean. The sand is your mat and the ocean is your soundtrack.</p><p style=\"box-sizing: inherit; backface-visibility: hidden; margin: 1rem 0px 0px; padding: 0px; border: 0px; font-family: &quot;Nunito Sans&quot;, sans-serif;\">Not only will you connect with your mind, body, and soul — you will connect with the beach around you. A truly unique experience that leaves you mentally and physically refreshed! Experience beach yoga all day long! Join a morning, afternoon, or sunset class!</p><div><br></div>', 'Practice yoga on the beach with the ocean as your soundtrack and the beautiful views as a backdrop. Feel relaxed and rejuvenated as you stretch your muscles and breathe the fresh air.', NULL, 'Book Now', 'https://www.beachyogasocal.com/schedule', NULL, NULL, 'on', NULL, '19', '31', '2021-09-03 04:53:42', '2021-10-13 04:31:51'),
(3, 'Sunset Beach Flow', 'The Sunset Heals All', 'test-class-title', 'Walter, Adrienne, Dani, Vanessa, Ally, Vee, Kathleen', 'Managment', 'All Levels', 'Sunday & Wednesday', 'images/SE4je5M2Q4qmL7cKbDgb0Kb5prrxl7MO7cz4F33L.jpg', '<p><font color=\"#202124\" face=\"Roboto, arial, sans-serif\">The serene sunset rays and your inner sensations meet to connect your body and spirit. Meditate, strengthen your body, relax and release your feelings!</font></p><p><font color=\"#202124\" face=\"Roboto, arial, sans-serif\">When the sun is setting, there is a magical feeling in the air, that of the light changing and another small cycle closing. This is the perfect time to practice and remind yourself of letting go, surrender, and trustfulness in your life journey.<br></font></p><p><font color=\"#202124\" face=\"Roboto, arial, sans-serif\">This Sunset Yoga session starts with Pranayama (breathing exercises). Every class has its unique flow of stretch, power, balance, and a general variety of Yoga Poses (Asanas), ending with Deep Relaxation in Savasana (resting pose).</font><br></p>', 'When the sun is setting, there is a magical feeling in the air, that of the light changing and another small cycle closing. This is the perfect time to practice and remind yourself of letting go, surrender, and trustfulness in your life journey.', NULL, 'Book Now', 'https://www.beachyogasocal.com/schedule', NULL, NULL, 'on', NULL, '19', '31', '2021-09-03 04:53:42', '2021-10-13 04:32:45'),
(4, 'Beach Power Flow 2/3', 'I Bend So I Don\'t Break', 'test-class-title', 'Walter, Adrienne, Dani, Vanessa, Ally, Vee', 'Managment', 'All Levels', 'Sunday, 10:30 am PST', 'images/ofGJI7Nx0dfBcVw9JDFVMexxT6AR19WEO9ZYUsEE.jpg', '<p>Power Flow will leave you feeling strong, open, relaxed, and ready to face the day! </p><p>This vigorous power flow practice uses movement and breath together to produce a “flow” of postures that lead naturally from one to the next. You will move at a pace designed to build internal heat, engage and build core strength while focusing on alignment and breath. </p><p>The connecting movements (vinyasa) between the postures help create enjoyable sequences that work all of the major joints and muscles of the body. This Power Flow class is for experienced yoga practitioners. Plan to sweat, so bring a towel!</p>', 'This vigorous power flow practice uses movement and breath together to produce a “flow” of postures that lead naturally from one to the next. You will move at a pace designed to build internal heat, engage and build core strength while focusing on alignment and breath.', NULL, 'Book Now', 'https://www.beachyogasocal.com/schedule', NULL, NULL, 'on', NULL, '19', '31', '2021-09-03 04:53:42', '2021-10-11 21:19:00'),
(5, 'Beach Flow Sound Bath', 'Letting Go Is The Hardest Asana', 'beach-flow-sound-bath', 'Vee & Zoe', 'Managment', 'All Levels', 'Thursday - Saturday', 'images/w0K0QLvkm0IIgL55FWliaZMYLIFOWX1jV09XOqMB.png', '<p>Join us for a 90-minute Gentle Yoga and Sound Bath Experience. </p><p>We will begin with gentle yoga poses to help guide your body into a deeply relaxed state. This will be followed by a sound bath incorporating Crystal Singing Bowls with vocal toning by Zoe. </p><p>This is the perfect practice to help to reduce stress and tension and harmonize your body, mind, and spirit.                    </p>', 'We will begin with gentle yoga poses to help guide your body into a deeply relaxed state. This will be followed by a sound bath incorporating Crystal Singing Bowls with vocal toning by Zoe.', NULL, 'Book Now', 'https://www.beachyogasocal.com/schedule', 'SoundBath', NULL, 'on', NULL, '31', '31', '2021-09-04 23:37:55', '2021-10-13 04:34:18'),
(6, 'Yoga Nidra on the Beach', 'Just Breathe!', 'yoga-nidra', 'Erica', 'Managment', 'All Levels', 'Tuesday, 6:30 pm PST', 'images/bMQdxonstbQ6Qad1fP0RxBaqShVYR1k3piPlFd89.jpg', '<p>A restorative guided meditation, Yoga Nidra translates to Yogic Sleep, allowing for deeply profound relaxation.&nbsp;</p><p><span style=\"font-size: 1rem;\">While resting savasana or a comfortable seated position, this unique guided mediation will help to quiet the overactive mind and unwind the nervous system as we journey through the physical, energy, mind/emotional, wisdom, and bliss bodies (known as the koshas).&nbsp;</span></p><p>Using a combination of breath awareness, body scanning, healing music, imagery, and visualizations, the practice allows you to explore your inner self.<br></p>', 'While resting savasana or a comfortable seated position, this unique guided mediation will help to quiet the overactive mind and unwind the nervous system as we journey through the physical, energy, mind/emotional, wisdom, and bliss bodies (known as the koshas).', NULL, 'Book Now', 'https://www.beachyogasocal.com/schedule', 'QiGong', NULL, 'on', NULL, '31', '31', '2021-09-05 00:02:32', '2021-10-13 04:36:02'),
(7, 'Sunset Sound Bath', 'Choose To Be Kind', 'reiki-sound-bath', 'Zoe', 'Managment', 'About', 'Thursday & Saturday', 'images/I2XzqnmSw0q9nGwUSOIER02crOE6NSp7ymGOOT1i.png', '<p>Join us for a beautiful evening on the beach in this exclusive Reiki &amp; Sound Bath Class! </p><p>Experience the waves of the ocean accompanied by the healing sounds of crystals bowls, conducted by the wonderful Zoe! Bring yourself, crystals, healing oils to enhance your healing experience! </p><p>Manifest with your crystal, breathe in the healing power of the essential oil, and experience the beautiful vibrations of the singing bowls as well as Zoe\'s angelical voice.</p>', 'Experience the waves of the ocean accompanied by the healing sounds of crystals bowls, conducted by the wonderful Zoe! Bring yourself, crystals, healing oils to enhance your healing experience!', NULL, 'Book Now', 'https://www.beachyogasocal.com/schedule', NULL, NULL, 'on', NULL, '31', '31', '2021-09-05 00:31:09', '2021-10-13 04:35:28'),
(8, 'Sunset Shavasana', 'The Pose Begins When You Want To Leave It', 'moving-meditation', 'Rob', 'Managment', 'All Levels', 'Tuesday', 'images/KguMvxI0XmyjaijVBFwigLtvu3lLTR4Ux5qtBwzY.jpg', '<p>“Energy Movement” is a form-based art, students learn a form that they can actually remember! This class is also known as “Energy Exercise”. </p><p>The practice of Moving Meditation is done in place and relates more toward internal energy and health.&nbsp; All movements are performed slowly with an emphasis on deep breathing techniques. </p><p>The history of this art goes back almost 3,000 years. Bring a smile to class. Improves balance, concentration, coordination, &amp; flexibility.                    </p>', 'The practice of Moving Meditation is done in place and relates more toward internal energy and health.  All movements are performed slowly with an emphasis on deep breathing techniques.', NULL, 'Book Now', 'https://www.beachyogasocal.com/schedule', NULL, NULL, 'on', NULL, '31', '31', '2021-09-05 01:37:52', '2021-10-13 04:37:44'),
(1, 'Signature Beach Flow', 'Rise And Shine', 'test-class-title', 'Walter, Adrienne, Dani, Vanessa, Ally, Vee', 'Managment', 'All Levels', 'Saturday & Sundays', 'images/VKzTHhU3Q9Qf60VY9gzdp5YhPRmWY3rw9MkomyGO.jpg', '<p>Start your day with an uplifting early-morning yoga class on the beach. Join an experienced instructor and fellow fitness enthusiasts on the beach for an energizing yoga session that\'s suitable for all ability levels. </p><p>There\'s no need to bring any worries—just come as you are!&nbsp;<span style=\"font-size: 1rem;\">You\'ll enjoy a soothing program of breathing exercises followed by a series of poses, with your instructor assisting you as needed. </span></p><p><span style=\"font-size: 1rem;\">Rise and shine every Monday and Tuesday at 6:15 am with the stillness of sunrise and waves gently lapping the shore.</span></p>', 'Start your day with an uplifting early-morning yoga class on the beach. Join an experienced instructor and fellow fitness enthusiasts on the beach for an energizing yoga session that\'s suitable for all ability levels.', NULL, 'Book Now', 'https://www.beachyogasocal.com/schedule', 'Yoga', NULL, 'on', NULL, '19', '31', '2021-09-03 04:53:42', '2021-10-13 04:31:17'),
(2, 'Beach Flow', 'Wake Up Your Senses', 'test-class-title', 'Walter, Adrienne, Dani, Vanessa, Ally, Vee', 'Managment', 'All Levels', 'Monday - Sunday', 'images/t2IfoKbPP6gGjEfMyX2yPSUUIF2oUVjb8kx67Nhk.jpg', '<p style=\"box-sizing: inherit; backface-visibility: hidden; margin: 1rem 0px 0px; padding: 0px; border: 0px; font-family: &quot;Nunito Sans&quot;, sans-serif;\">Beach flow yoga is a class for all levels and ages.</p><p style=\"box-sizing: inherit; backface-visibility: hidden; margin: 1rem 0px 0px; padding: 0px; border: 0px; font-family: &quot;Nunito Sans&quot;, sans-serif;\">Stretch and strengthen your muscles while breathing in the fresh air. Work up a sweat and cool off in the ocean. The sand is your mat and the ocean is your soundtrack.</p><p style=\"box-sizing: inherit; backface-visibility: hidden; margin: 1rem 0px 0px; padding: 0px; border: 0px; font-family: &quot;Nunito Sans&quot;, sans-serif;\">Not only will you connect with your mind, body, and soul — you will connect with the beach around you. A truly unique experience that leaves you mentally and physically refreshed! Experience beach yoga all day long! Join a morning, afternoon, or sunset class!</p><div><br></div>', 'Practice yoga on the beach with the ocean as your soundtrack and the beautiful views as a backdrop. Feel relaxed and rejuvenated as you stretch your muscles and breathe the fresh air.', NULL, 'Book Now', 'https://www.beachyogasocal.com/schedule', NULL, NULL, 'on', NULL, '19', '31', '2021-09-03 04:53:42', '2021-10-13 04:31:51'),
