(57, 'BEACHYOGA CORPORATE DISCOUNTS', NULL, 'beachyoga-corporate-discounts', 'Corporate', 'Banner', NULL, 'images/ngGula5ikxCzWZWDphAHwZKCHTy6TuCTzNIJrDMt.jpg', '<span style=\"color: rgb(61, 61, 61); font-family: Roboto, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 18px; text-align: center;\">The success of your team depends on the performance of its members. That’s why you should encourage yours to set up a recurring meeting on their yoga mats.</span><br style=\"color: rgb(61, 61, 61); font-family: Roboto, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 18px; text-align: center;\"><span style=\"color: rgb(61, 61, 61); font-family: Roboto, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 18px; text-align: center;\">A yoga practice may boost your team\'s well-being and productivity, relieve workplace stress, and could reduce your health care expenses. That’s why YogaWorks is proud to offer your entire company discounts for both our in-studio and online programming. Help make your employees happier and healthier both on and off the mat!</span><br style=\"color: rgb(61, 61, 61); font-family: Roboto, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 18px; text-align: center;\"><span style=\"color: rgb(61, 61, 61); font-family: Roboto, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 18px; text-align: center;\">Complete the form below and a YogaWorks team member will be in touch shortly to answer all of your questions about our corporate discount program.</span>', NULL, NULL, NULL, NULL, 'on', NULL, '31', '', '2021-09-02 15:40:05', '2021-09-02 15:40:05'),
