INSERT INTO `posts1` (`id`, `parent`, `page_title`, `title`, `sub_title`, `slug`, `page`, `position`, `category_id`, `image`, `image_m`, `description`, `short_description`, `meta_description`, `link_title`, `link_action`, `active`, `hit_count`, `created_by`, `updated_by`, `created_at`, `updated_at`) VALUES
(1, NULL, NULL, 'shohabn', 'MPI has been at the forefront of the Colombian asphalt industry since 1974, placing all efforts into providing eco-friendly, technically advanced, and cost-effective solutions, that adapt to the diversity of the LATAM market.', 'the-modern-way-to-get-tax-relief-work-done', 'Home', 'Banner', NULL, NULL, NULL, NULL, NULL, NULL, 'Let\'s Get Started', '#', 'on', NULL, '44', '44', '2023-11-20 03:53:20', '2024-05-19 00:41:15'),
(2, NULL, NULL, 'Access to high quality Tax Professionals on demand', NULL, 'access-to-high-quality-tax-professionals-on-demand', 'Home', 'Section 6', NULL, NULL, NULL, '<ul>\r\n									<li>Tax Professionals have an average of 15 years of experience</li>\r\n									<li>Profiles of our online Tax Professionals display client ratings and reviews of recent work</li>\r\n									<li>Find Tax Professionals anywhere for every legal need</li>\r\n									<li>Ask an expert and receive professional advice online</li>\r\n								</ul>', NULL, NULL, 'See More Project', '#', 'on', NULL, '44', '44', '2023-11-20 04:33:55', '2023-11-20 05:08:00'),
(68, NULL, NULL, 'Road Preservation', NULL, 'our-services', 'Home', 'Section 2', NULL, 'images/8y1iUAEAvnRO1UHxKnMRc2z27Hr2lydAs6MFZDLL.svg', 'images/havmfqrUF6guyNbYI4q063WkR6NU3cJQwQlfuGvq.svg', NULL, 'To ensure every road stands the test of time and traffic, we deliver cost-effective solutions that prioritize maintenance.', NULL, NULL, NULL, 'on', NULL, '44', '44', '2024-04-17 06:12:57', '2024-04-18 05:53:52'),
(69, NULL, NULL, 'Go-Green', NULL, 'go-green', 'Home', 'Section 4', NULL, 'images/mUeYx8YWfkTubKgw1bA3nqHRmWJbaUuIJJ6qGir3.png', NULL, NULL, 'Reducing the environmental impact without compromising quality exemplifies our commitment to eco-innovation. \r\n									<span class=\"green_content_m_gap\"> <br> <br> </span>\r\n\r\n									By utilizing reclaimed materials through solutions such as Asphalt Rubber and Asphalt Modified with Post-Consumer Plastic, we not only enhance the performance of our asphalts but support the development of eco-friendly roadways.', NULL, NULL, NULL, 'on', NULL, '44', '44', '2024-04-17 06:15:24', '2024-04-18 04:23:46'),
(70, '69', NULL, 'Recycled Tires', '1,600,000+', 'recycled-tires', 'Home', 'Section 4', NULL, 'images/Y1j97NP4HNA2fpfNrXzf1B8F2kSw54tJr9kLsyYb.svg', NULL, '<p><br></p>', 'Fully repurposed to work with Asphalt Modified with Recycled Rubber Grain, since 2009. As of 2023, we offer this product for Warm Mix applications.', NULL, NULL, NULL, 'on', NULL, '44', '44', '2024-04-18 03:41:22', '2024-04-18 04:08:12'),
(71, '69', NULL, 'Recycled Plastic Bags', '4,550,000+', 'recycled-plastic-bags', 'Home', 'Section 4', NULL, 'images/OIADgoHrwZANVYOMkI7tc6QEEUMnpw4Qb1YpwUA7.svg', NULL, '<p><br></p>', 'Reused when modifying asphalt with 6,500 kg of recycled plastic, starting in 2022. Reach out for further information about its application.', NULL, NULL, NULL, 'on', NULL, '44', '', '2024-04-18 04:07:26', '2024-04-18 04:07:26'),
(72, '69', NULL, 'Solar Energy', '25%', 'solar-energy', 'Home', 'Section 4', NULL, 'images/lNOEIrOgIJ3mI4CuX12oRgzScOK6V34mA5RwrRR5.svg', NULL, NULL, 'Barrancabermeja is Colombia\'s Sun City and the location for our main production plant, equipped with solar panels that are dedicated to our ongoing operation.', NULL, NULL, NULL, 'on', NULL, '44', '', '2024-04-18 04:22:33', '2024-04-18 04:22:33'),
(73, NULL, NULL, 'About MPI', NULL, 'about-mpi', 'Home', 'Section 6', NULL, NULL, NULL, '<p><br></p>', 'MPI turned 50 this year, and our vision for the next 50 goes beyond infrastructure; we\'re committed to the economic development and environmental preservation that roads bring to our society.', NULL, NULL, NULL, 'on', NULL, '44', '44', '2024-04-18 04:28:11', '2024-04-18 04:30:53'),
(74, '73', NULL, 'Countries', '09', 'countries', 'Home', 'Section 6', NULL, NULL, NULL, NULL, 'We currently participate in 9 different countries located in North, South, and Central America.', NULL, NULL, NULL, 'on', NULL, '44', '', '2024-04-18 04:46:50', '2024-04-18 04:46:50'),
(75, '73', NULL, 'Asphalt Plants', '04', 'asphalt-plants', 'Home', 'Section 6', NULL, NULL, NULL, NULL, 'All strategically placed within Colombia to cover national and international markets.', NULL, NULL, NULL, 'on', NULL, '44', '', '2024-04-18 04:50:51', '2024-04-18 04:50:51'),
(76, '73', NULL, 'Emulsion Plants', '06', 'emulsion-plants', 'Home', 'Section 6', NULL, NULL, NULL, NULL, '3 fixed and 3 portable emulsion plants distributed to optimize project logistics in LATAM', NULL, NULL, NULL, 'on', NULL, '44', '', '2024-04-18 04:53:33', '2024-04-18 04:53:33'),
(77, '73', NULL, 'People', '126', 'people', 'Home', 'Section 6', NULL, NULL, NULL, NULL, 'Our MPI team is made up of 100+ experts determined to play a heavy part in road solutions.', NULL, NULL, NULL, 'on', NULL, '44', '', '2024-04-18 04:54:48', '2024-04-18 04:54:48'),
(78, NULL, NULL, 'Laboratory', NULL, 'laboratory', 'Home', 'Section 2', NULL, 'images/RxqRICDjbiz2BkWGatKbDChVo280wtPf5LMvC9F9.svg', 'images/pPM06qcpr4dkzLIo6Vf5kj7y3fUbOiYRJM6CCNts.svg', NULL, 'Our Lab is the epicenter of MPI\'s technological advancements in the asphalt industry.', NULL, NULL, NULL, 'on', NULL, '44', '44', '2024-04-18 05:57:07', '2024-04-18 06:00:10'),
(79, NULL, NULL, 'Consulting', NULL, 'consulting', 'Home', 'Section 2', NULL, 'images/XqxoNAmiv32HJ1hOqGWICvKoMDwv3Dz9JuYQS05I.svg', 'images/KKylybMHEV0YnNzNWSZJ6fUOZK74yjHskhiYRPcG.svg', NULL, 'Our seasoned consultants offer tailored guidance through the complexities of the ever-evolving asphalt/bitumen industry.', NULL, NULL, NULL, 'on', NULL, '44', '', '2024-04-18 06:07:14', '2024-04-18 06:07:14'),
(80, NULL, NULL, 'Explore Our Asphalt Portfolio', NULL, 'explore-our-asphalt-portfolio', 'Asphalt', 'Banner', NULL, NULL, NULL, NULL, 'Welcome to our EXPORT Portfolio. Here, we present our range of international asphalt products. Our dedication to maintaining the best standards in quality and innovation is a testament to our commitment to the asphalt industry. We aim to provide solutions that meet essential expectations and cater to our customers\' varied needs.', NULL, NULL, NULL, 'on', NULL, '44', '44', '2024-04-21 00:47:21', '2024-04-24 22:11:06'),
(81, NULL, NULL, 'Polybit', NULL, 'polybit', 'Asphalt', 'Section 2', NULL, 'images/FKSfKczuvY914pBzNFrrmxIoU9BmjJSkpKQ3nh12.png', 'images/NUm77POtnah8TVzbMZG9xFJ3qQRFXjRCyp4u8Tss.png', NULL, 'Our Crack Sealer is a specially formulated product designed to fill and seal cracks in asphalt and concrete surfaces, preventing further deterioration and extending the pavement\'s life. With a focus on durability and ease of use, it is ideal for maintaining both commercial and residential pavements. The sealer accommodates the natural expansion and contraction of surfaces, ensuring a long-lasting repair. Adheres to ASTM-D6690 and equivalent standards.', NULL, NULL, NULL, 'on', NULL, '44', '44', '2024-04-21 00:57:44', '2024-04-21 01:01:48'),
(82, NULL, NULL, 'Global Pavement Consultancy & Technical Training', NULL, 'global-pavement-consultancy-technical-training', 'Consulting', 'Banner', NULL, NULL, NULL, NULL, 'We bring specialized knowledge and expertise to your company, offering insights into best practices, innovative technologies, and advanced methodologies in the asphalt industry.', NULL, NULL, NULL, 'on', NULL, '44', '', '2024-04-25 00:27:21', '2024-04-25 00:27:21'),
(83, NULL, NULL, 'Global Expertise in Your Local Language', NULL, 'global-expertise-in-your-local-language', 'Consulting', 'Section 3', NULL, 'images/z0VpP5GWoS0DEVfej7GVCRTtMvS9cDRKWokgT7op.png', NULL, NULL, 'MPI specializes in road construction, preservation, and expert consulting across the Americas. Our bilingual team ensures smooth communication and adherence to international standards. \r\n					<br><br>\r\n					With cutting-edge laboratory research and sustainable practices, we’re not just building roads—we’re engineering lasting journeys.\r\nWith cutting-edge laboratory research and sustainable practices, we’re not just building roads—we’re engineering lasting journeys.', NULL, NULL, NULL, 'on', NULL, '44', '44', '2024-04-25 00:34:04', '2024-04-25 00:41:45'),
(84, NULL, NULL, 'Training And Development', NULL, 'training-and-development', 'Consulting', 'Section 5', NULL, 'images/LZs7dhtmhHD0oOI1UeV6n10iqxqVeLur5PnTfAuz.png', NULL, NULL, 'We provide training and development for your staff, bringing them up-to-date with the latest industry trends, technologies, and best practices, enhancing their skills and your company\'s opportunities.', NULL, NULL, NULL, 'on', NULL, '44', '', '2024-04-25 00:49:36', '2024-04-25 00:49:36'),
(85, NULL, NULL, 'Advancing Asphalt Technology', NULL, 'advancing-asphalt-technology', 'Lab', 'Banner', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'on', NULL, '44', '', '2024-04-25 04:21:16', '2024-04-25 04:21:16'),
(86, NULL, NULL, 'Asphalt Advances', NULL, 'asphalt-advances', 'Lab', 'Section 1', NULL, 'images/eHdkhmQiiSNcWtbe6qiMFNCnK7S6pYaFf6TDJhP3.png', NULL, NULL, 'Our laboratory serves as a hub for asphalt technology, emphasizing quality and durability in road materials through rigorous research and diverse testing. <br><br>Regionally recognized, our team is dedicated to ongoing research and international collaboration. We strive to craft asphalt formulations that meet market standards and foster industry growth.', NULL, NULL, NULL, 'on', NULL, '44', '', '2024-04-25 04:25:06', '2024-04-25 04:25:06'),
(87, NULL, NULL, 'EcoSmart Asphalt', 'Find out what happens when you mix asphalt and plastic', 'ecosmart-asphalt', 'Lab', 'Section 2', NULL, 'images/vMDonU9lKxQEVegZnN7fsSAqfX36l4uqq7Ji8s1j.png', NULL, NULL, 'Our Lab is committed to innovation, continuously exploring new avenues in asphalt technology. We focus on developing sustainable and efficient asphalt solutions, aiming to contribute positively to the industry. <br><br>Our approach is grounded in rigorous research and a dedication to practical advancements in asphalt production and application.', NULL, NULL, NULL, 'on', NULL, '44', '', '2024-04-25 04:36:14', '2024-04-25 04:36:14'),
(88, NULL, NULL, 'Service Selection', NULL, 'service-selection', 'Lab', 'Section 3', NULL, NULL, NULL, NULL, 'In the diverse world of asphalt additives, each product offers unique benefits under the right circumstances. Our laboratory specializes in understanding these nuances to identify the ideal additive formulation for your specific situation. Whether it\'s adapting to environmental conditions, traffic loads, or material characteristics, we meticulously analyze your project\'s requirements to ensure the selected formulation maximizes pavement performance and longevity.', NULL, NULL, NULL, 'on', NULL, '44', '', '2024-04-25 04:42:35', '2024-04-25 04:42:35'),
(89, NULL, NULL, 'Our Pilot Plant Simulates Production Processes...', NULL, 'our-pilot-plant-simulates-production-processes', 'Lab', 'Section 4', NULL, 'images/6f48c08q2btKDuXI182mACG3YvusqKGyoKTHjw2a.png', NULL, NULL, 'A pilot plant can simulate actual production processes on a smaller scale, allowing researchers to study the behavior and properties of asphalt under conditions that closely mimic real-world applications.', NULL, NULL, NULL, 'on', NULL, '44', '', '2024-04-25 04:48:27', '2024-04-25 04:48:27');
INSERT INTO `post_sections` (`id`, `post_id`, `title`, `sub_title`, `image`, `description`, `link_title`, `link_action`, `active`, `created_by`, `updated_by`, `created_at`, `updated_at`) VALUES
(49, 'YOGA FOR E', 'YOGA FOR EVERYONE', 'What is beach yoga socal', 'images/SuvOfqouk4fN6Zpa6vA2uNh2Pq6Iq345DzMM0cTB.png', NULL, NULL, NULL, 'on', '19', '31', '2021-08-29 00:22:09', '2021-09-28 02:59:32'),
(50, 'What is Be', 'What is Beach Yoga Socal', NULL, 'images/DdkenAqplxtPETLxK34hoU9JmdGSNZIvMLkkYsOf.png', '<p dir=\"ltr\" style=\"line-height:1.38;margin-top:0pt;margin-bottom:0pt;\"><font color=\"#3d3d3d\" face=\"Montserrat, sans-serif\" style=\"font-size: 1rem;\"><span style=\"font-size: 14.6667px; white-space: pre-wrap;\">Get out of the studio and onto the beach for a yoga experience unlike any other! </span></font><span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-size: 11pt; font-family: Montserrat, sans-serif; color: rgb(61, 61, 61); font-weight: 700; vertical-align: baseline; white-space: pre-wrap;\">Beach Yoga SoCal is Southern California’s Original Beach Yoga Experience since 2008</span><span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-size: 11pt; font-family: Montserrat, sans-serif; color: rgb(61, 61, 61); vertical-align: baseline; white-space: pre-wrap;\">.</span><font color=\"#3d3d3d\" face=\"Montserrat, sans-serif\" style=\"font-size: 1rem;\"><span style=\"font-size: 14.6667px; white-space: pre-wrap;\"> Breathe to the rhythm of the waves, feel the sand running through your fingers, taste the salty ocean mist, listen to soothing sounds of crashing waves, and look out for dolphins and whales! Elevate your practice by connecting with nature, and meditate with the sunset. </span></font></p><p dir=\"ltr\" style=\"line-height:1.38;margin-top:0pt;margin-bottom:0pt;\"><font color=\"#3d3d3d\" face=\"Montserrat, sans-serif\" style=\"font-size: 1rem;\"><span style=\"font-size: 14.6667px; white-space: pre-wrap;\"><br></span></font></p><p dir=\"ltr\" style=\"line-height:1.38;margin-top:0pt;margin-bottom:0pt;\"><font color=\"#3d3d3d\" face=\"Montserrat, sans-serif\" style=\"font-size: 1rem;\"><span style=\"font-size: 14.6667px; white-space: pre-wrap;\">All levels are welcome. Modifications for beginners-advanced yogis are offered for all poses. All of our instructors are licensed and permitted by the City of Santa Monica. Additionally, our instructors are certified and independently insured!</span></font><br></p>', NULL, NULL, 'on', '19', '31', '2021-08-29 00:26:15', '2021-10-06 20:02:24'),
(51, 'Vee Gomez ', 'Vee Gomez - Founder', NULL, 'images/ggApUvubF1XdeZ0e5RYw793w6CSNMavOxoVQfntJ.jpg', '<p>An Award-Winning member of the Santa Monica community and known beach dweller, Vee Gomez is the CEO and lead yoga instructor of Beach Yoga SoCal. On a mission to spread mindful living, Vee loves teaching yoga on the beach and reminding students of the ocean’s therapeutic properties. “Yoga is simply being aware. Aware of one’s surroundings. Aware of the body. Aware of the breath,” she says. “Once you have this awareness, you’ll move more fluidly through life. This is what I aim to teach my students. The ocean, sand, and air help me do that.” In her classes, Vee shows students how to connect with their environment while bending and moving the body in a functional way. When she’s not teaching, Vee spends time with her husband and three dogs. She loves eating different foods and writing poetry in her free time.<br></p>', NULL, NULL, 'on', '19', '31', '2021-08-29 00:26:49', '2021-10-06 20:00:30'),
(52, 'Beach Loca', 'Beach Location', NULL, 'images/5o7aMbfN0N783KiPrMiif7KpnJe12U5cPks8fPGA.jpg', NULL, 'Directions, Parking, Bus/Metro', '#Directions,#Bottom,#Bottom', 'on', '19', '31', '2021-08-29 04:41:29', '2021-09-26 08:36:40'),
(53, 'Our Beach ', 'Our Beach Locations', NULL, 'images/rLBOUvGcaQSPus5NpfGL5Tvn15029PKszaNkNlJ8.png', '<p></p><h6><span style=\"color: rgb(37, 100, 169) !important;\">Phone:&nbsp;<a href=\"tel:14242625362\" target=\"_blank\">1 (424) 262-5362</a></span><br></h6>\r\n\r\n<h6><span style=\"color: rgb(37, 100, 169) !important;\">Email:&nbsp;<a href=\"https://mail.google.com/mail/u/0/?fs=1&amp;tf=cm&amp;source=mailto&amp;to=info@beachyogasocal.com\" target=\"_blank\">info@beachyogasocal.com</a></span><br></h6>\r\n\r\n<h6><span style=\"color: rgb(37, 100, 169) !important;\">Address:&nbsp;<a href=\"https://www.google.com/maps?rlz=1C1GCEU_enPH890PH890&amp;q=Beach+Yoga+SoCal,+Ocean+Front+Walk,+Santa+Monica,+CA,+USA&amp;gs_lcp=CgZwc3ktYWIQAzoHCAAQRxCwA1C1JVi1JWCTJ2gDcAB4AIABdogBdpIBAzAuMZgBAKABAqABAaoBB2d3cy13aXrAAQE&amp;uact=5&amp;um=1&amp;ie=UTF-8&amp;sa=X&amp;ved=2ahUKEwiS4-_Fve7qAhVDL6YKHdSoAMkQ_AUoAXoECBsQAw\" target=\"_blank\">2600 Ocean Front Walk Santa Monica CA 90405</a></span><br></h6>\r\n\r\n<h6><span style=\"color: rgb(37, 100, 169) !important;\">Address:&nbsp;<a href=\"https://www.google.com/maps/place/Annenberg+Community+Beach+House/@34.0244025,-118.515512,17z/data=!3m1!4b1!4m5!3m4!1s0x80c2a4944c31748f:0xa736245290fc2352!8m2!3d34.0244025!4d-118.5133233\" target=\"_blank\">415 Pacific Coast Hwy, Santa Monica, CA 90402 (Closest address to Lifeguard Tower 4)</a></span></h6><h6><span style=\"color: rgb(37, 100, 169) !important;\">Address:&nbsp;</span><font color=\"#2564a9\">5500 Ocean Front Walk, Marina Del Rey, CA 90292 (Charlie Beach&nbsp;Lifeguard Tower 50)</font></h6><h6><b style=\"font-size: .5rem;\"><br></b></h6><h6><b style=\"font-size: 1rem;\">NOTE: We have grown and now we are providing yoga classes in three different locations.&nbsp;</b><br></h6><p></p><ul><li><b style=\"font-size: 1rem;\">Our first location is directly on the beach, South of Santa Monica Pier by Lifeguard Tower 26</b></li><li><span style=\"font-size: 1rem;\"><b>Our second location is North of Santa Monica Pier by the&nbsp;</b></span><font color=\"#2564a9\">Annenberg Beach House location</font></li></ul><p><b style=\"font-size: 1rem;\">We recommend looking up our location ahead of time and reaching out to us with any questions.</b></p>', NULL, NULL, 'on', '19', '31', '2021-08-29 04:42:23', '2022-05-02 20:38:08'),
