(66, 'Direction ', 'Direction for Parking', NULL, 'images/Mc1O1RdjgIwqEJZYHMDIdbiFAizHWGh906Wh6DyG.png', '<h2 class=\"\" style=\"box-sizing: border-box; margin-bottom: 0.5rem; font-family: Montserrat, sans-serif; font-weight: 700; line-height: 1.2; color: rgb(34, 34, 34); font-size: 2rem; letter-spacing: normal; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; orphans: 2; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\"><span style=\"color: rgb(37, 100, 169); font-family: sans-serif; font-size: 1rem; font-weight: normal;\">From Los Angeles:</span><br></h2><p>Take the 10 West, which will become Pacific Coast Highway when it reaches the beach.  At the second traffic light, Beach House Way, turn left into the parking lot.</p><h2 class=\"\" style=\"font-weight: 700; font-family: Montserrat, sans-serif; color: rgb(34, 34, 34);\"><span style=\"font-weight: normal; font-family: sans-serif; font-size: 1rem; color: rgb(37, 100, 169) !important;\">From Malibu:</span><br></h2><p>Take Pacific Coast Highway south.  Turn right at Beach House Way, into the parking lot.</p><h2 class=\"\" style=\"font-weight: 700; font-family: Montserrat, sans-serif; color: rgb(34, 34, 34);\"><span style=\"font-weight: normal; font-family: sans-serif; font-size: 1rem; color: rgb(37, 100, 169) !important;\">From Santa Monica (Downtown):</span><br></h2><p>Head west towards Ocean Ave.  Turn left at Ocean Ave.  Turn right at Moomat Ahiko Way (after Colorado/the pier entrance) which will have signs for Pacific Coast Highway.  Turn left at Beach House Way into our parking lot.</p><h2 class=\"\" style=\"font-weight: 700; font-family: Montserrat, sans-serif; color: rgb(34, 34, 34);\"><span style=\"font-weight: normal; font-family: sans-serif; font-size: 1rem; color: rgb(37, 100, 169) !important;\">Parking Annenberg Community Beach House:</span><br></h2><p>Parking near the Annenberg is $3/hour or $8-$10/day depending on the season. If the Beach House lot is full, additional parking lots 8 &amp; 9 (south) and Will Rogers State Beach (north) are within walking distance. The bike path connects these lots to the Beach House on the ocean side.\r\n\r\n</p><p> </p>', NULL, NULL, 'on', '19', '31', '2021-08-29 04:42:23', '2021-11-14 02:57:39'),
